import axios from "axios";

function Currentweather ({e}){
    if(e)
    return (
     <div>
       <h1 fontSize="200px"  >{e.location.name}</h1>
       <p>{e.current.temp_c}<sup>o</sup>C</p>
       <div>
           <h1>{e.current.condition.text}</h1>
           <img src={`https:${e.current.condition.icon}` }/>
       </div>
     </div>
    )
}

export default Currentweather;
